# Get list of all peptide modification names
def get_peptide_modification_names():
    return list(get_peptide_modifications().keys())


# Extract masses from peptide modification dictionary
def get_peptide_modification_masses():
    # Read modifications from peptide modification dictionary
    modifications = get_peptide_modifications()

    peptide_modification_masses = {}

    for modification_name, modification_properties in modifications.items():

        # Split modification properties
        modification_properties = modification_properties.split(' ')

        # Extract modification mass and neutral loss from modification properties
        modification_mass = float(modification_properties[2])
        modification_neutral_loss = float(modification_properties[5]) if modification_properties[4] != '0' else 0

        # Add modification mass and neutral loss to the modification masses dictionary
        peptide_modification_masses[modification_name] = (modification_mass, modification_neutral_loss)

    return peptide_modification_masses
